import * as React from 'react';
import Button from '@mui/material/Button';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';

export default function BasicMenu() {
  const [anchorEl, setAnchorEl] = React.useState(null);
  const [shouldCloseMenu, setShouldCloseMenu] = React.useState(true);

  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    if (shouldCloseMenu) {
      setAnchorEl(null);
    }
    setShouldCloseMenu(true);
  };

  const handleMenuItemClick = () => {
    setShouldCloseMenu(false);
    // Add your specific action here
  };

  return (
    <div>
      <Button
        id="basic-button"
        aria-controls={anchorEl ? 'basic-menu' : undefined}
        aria-haspopup="true"
        aria-expanded={anchorEl ? 'true' : undefined}
        onClick={handleClick}
      >
        Dashboard
      </Button>
      <Menu
        id="basic-menu"
        anchorEl={anchorEl}
        open={Boolean(anchorEl)}
        onClose={handleClose}
        MenuListProps={{
          'aria-labelledby': 'basic-button',
        }}
      >
        <MenuItem onClick={handleMenuItemClick}>Profile</MenuItem>
        <MenuItem onClick={handleMenuItemClick}>My account</MenuItem>
        <MenuItem onClick={handleMenuItemClick}>Logout</MenuItem>
      </Menu>
    </div>
  );
}
